#!/usr/bin/env python
"""Test script to reproduce the issue with protected keys not raising errors"""

import json
from pathlib import Path
from sepal_ui.translator import Translator

# set up the appropriate keys for each language
keys = {
    "en": {
        "find_target": "A key",
        "test_key": "Test key",
        "nested" : {
            "items" : {
                "_target" : "value"
            },
        },
        "merge_dict" : "value"
    },
    "fr": {
        "a_key": "Une clef",
        "test_key": "Clef de test"
    },
    "fr-FR": {
        "a_key": "Une clef",
        "test_key": "Clef de test"
    },
    "es": {
        "a_key": "Una llave"
    },
}

# generate the tmp_dir in the test directory
tmp_dir = Path(__file__).parent / "data" / "messages"
tmp_dir.mkdir(exist_ok=True, parents=True)

# create the translation files
for lan, d in keys.items():
    folder = tmp_dir / lan
    folder.mkdir(exist_ok=True)
    (folder / "locale.json").write_text(json.dumps(d, indent=2))

try:
    print("Testing instantiation with protected keys in nested levels...")
    translator = Translator(tmp_dir, "en")
    print("ERROR: No exception was raised! The bug still exists.")
    exit(1)
except Exception as e:
    print(f"SUCCESS: Exception raised as expected: {e}")
    exit(0)
finally:
    # cleanup
    import shutil
    shutil.rmtree(tmp_dir)
